/*Table structure for table `tb_resultessay` */

DROP TABLE IF EXISTS `tb_resultessay`;

CREATE TABLE `tb_resultessay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_user` int(11) DEFAULT NULL,
  `id_essay` int(11) DEFAULT NULL,
  `jawaban` varchar(255) DEFAULT NULL,
  `nilai` int(11) DEFAULT NULL,
  `latihan_ke` varchar(255) DEFAULT NULL,
  `id_korektor` int(11) DEFAULT NULL,
  `timeopen` varchar(255) DEFAULT NULL,
  `timeupdate` varchar(255) DEFAULT NULL,
  `pathName` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_tb_resultessay` (`id_essay`),
  KEY `FK_tb_resultessaycorrect` (`id_korektor`),
  KEY `FK_tb_resultessayuser` (`id_user`),
  CONSTRAINT `FK_tb_resultessay` FOREIGN KEY (`id_essay`) REFERENCES `tb_essay` (`id`),
  CONSTRAINT `FK_tb_resultessaycorrect` FOREIGN KEY (`id_korektor`) REFERENCES `tb_user` (`id`),
  CONSTRAINT `FK_tb_resultessayuser` FOREIGN KEY (`id_user`) REFERENCES `tb_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tb_resultessay` */

/*Table structure for table `tb_resultexercise` */

DROP TABLE IF EXISTS `tb_resultexercise`;

CREATE TABLE `tb_resultexercise` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_collerger` int(11) DEFAULT NULL,
  `id_matery` int(11) DEFAULT NULL,
  `id_qa` int(11) DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `short_answer` varchar(255) DEFAULT NULL,
  `timeopen` varchar(255) DEFAULT NULL,
  `timeclose` varchar(255) DEFAULT NULL,
  `timecreated` varchar(255) DEFAULT NULL,
  `timemodified` varchar(255) DEFAULT NULL,
  `poin` int(11) DEFAULT NULL,
  `id_category` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_tb_resultexercise` (`id_qa`),
  KEY `FK_tb_resultexercisemtr` (`id_matery`),
  KEY `FK_tb_resultexercisectr` (`id_category`),
  KEY `FK_tb_resultexerciseclg` (`id_collerger`),
  CONSTRAINT `FK_tb_resultexercise` FOREIGN KEY (`id_qa`) REFERENCES `tb_qa` (`id`),
  CONSTRAINT `FK_tb_resultexerciseclg` FOREIGN KEY (`id_collerger`) REFERENCES `tb_user` (`id`),
  CONSTRAINT `FK_tb_resultexercisectr` FOREIGN KEY (`id_category`) REFERENCES `tb_category` (`id`),
  CONSTRAINT `FK_tb_resultexercisemtr` FOREIGN KEY (`id_matery`) REFERENCES `tb_matery` (`id`)
