  CONSTRAINT `FK_tb_resultquizus` FOREIGN KEY (`id_colleger`) REFERENCES `tb_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

